import React from "react";
import Link from "next/link";
import { connect } from "react-redux";

const IndexPage = () => {
  return (
    <>
      <Link href="Login">
        <a>Login</a>
      </Link>
    </>
  );
};

IndexPage.getInitialProps = ({ reduxStore }) => {};

export default connect(null, {})(IndexPage);
